import React from 'react';

import './tailwind.css';
import Navbar from './app_components/navbar'
import Weather from './app_components/weather.component'
import Loc from './app_components/location'
import Weathers from './app_components/weathers.component'
//api.openweathermap.org/data/2.5/weather?q=${city_name}&appid=${api_key}
const api_key='aef5f0f7ef1f482eb40aeaa93c360e1e'
const city_name='London'
class App extends React.Component {
  constructor()
  {
    super();
    this.state = {};
  }
  getWeather = async () =>
  {
    const api_call = await fetch(`http://api.openweathermap.org/data/2.5/weather?q=${city_name}&appid=${api_key}`)
  }
  render()
  {
    return (
      <div className="App">
        <Navbar/>
        <div className='w-full h-screen flex'>
          <div className='bg-green-900 w-1/4 h-screen '>
            <div className='flex-col h-screen flex justify-center index-center'>
              <Weathers/>
              <Weathers/>
              <Weathers/>
              <Weathers/>
              <Weathers/>
              <Weathers/>
             </div>
          </div>
          <div className='flex justify-center flex items-center bg-blue-900 w-2/4 h-screen'>
            <div ><Weather/><Loc/></div>
          </div>  
          <div className='flex justify-center flex items-center bg-red-900 w-1/4 h-screen'>Contextual icon</div>

        </div>
      </div>
      );
  }
}

export default App;
